      // this.info_sidebar_marche.disablePanel('infomarche');
    },
    videInfrastructure(){
      this.infrastructure=""
      // this.zoom=5;
      // this.objetUnite=""
      // this.info_sidebar_marche.close()
      // this.info_sidebar_marche.disablePanel('infomarche');
    },
  },
  mounted(){

  }

}
</script>

